import React from 'react';
import Text from "./Text";

function ListServices({
                    smm=false,
                    websites = false,
                    mobileApps = false,
                    design = false,
                      }) {

    function textEmphasize(choice, text){
        if(choice){
            return <Text text={text} color="#D24A6A" fontWeight={700}></Text>
        }
        return <Text text={text} color=""></Text>
    }
    return (
        <div className="row">
            <Text text="SMM"></Text>
            <Text text="Websites"></Text>
            <Text text="Mobile Apps"></Text>
            <Text text="Design"></Text>
        </div>
    );
}

export default ListServices;
